CREATE DEFINER=`root`@`localhost` FUNCTION `CrearPrt` (`_IDPartida` INT UNSIGNED, `_PuntosFinal` TINYINT UNSIGNED, `_TiempoMax` TINYINT UNSIGNED, `_TiempoTurno` TINYINT UNSIGNED, `_IDJugador1` INT UNSIGNED, `_IDJugador2` INT UNSIGNED, `_IDJugador3` INT UNSIGNED, `_IDJugador4` INT UNSIGNED) RETURNS TINYINT(3) UNSIGNED  BEGIN

DECLARE crearpartida TINYINT UNSIGNED DEFAULT 0;

    SELECT IDPartida INTO crearpartida
        from Partida     
        WHERE IDPartida= _IDPartida AND IDJugador = _IDJugador1 AND IDJugador = _IDJugador2 
        AND IDJugador = _IDJugador3 AND IDJugador = _IDJugador4 AND PuntosFinal = _PuntosFinal
        AND TiempoMax = _TiempoMax AND TiempoTurno = _TiempoTurno;

RETURN crearpartida;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `GetCostCrtClr` (`_IDCartas` CHAR(12), `_IDColor` ENUM('red','green','blue','white','black')) RETURNS TINYINT(3) UNSIGNED  BEGIN
    DECLARE cost TINYINT UNSIGNED;

    SELECT Coste INTO cost
    FROM carcol
    WHERE IDCartas = _IDCartas
    AND IDColor = _IDColor;
    
    RETURN cost ;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `GetNewCartaNivelAcc` (`_Nivel` TINYINT UNSIGNED, `_IDPartida` INT UNSIGNED, `_IDJugador` TINYINT UNSIGNED, `_Turno` INT UNSIGNED) RETURNS VARCHAR(16) CHARSET utf8mb4  BEGIN
DECLARE IDNuevaCrt VARCHAR(16) DEFAULT NULL; 

SELECT IDCartas INTO IDNuevaCrt
FROM Cartas
WHERE Nivel = _Nivel AND
IDCartas NOT IN (
SELECT IDCartas
FROM CartasTablero
WHERE IDPartida = _IDPartida
UNION SELECT IDCartas from cartasparticipant
WHERE IDPartida = _IDPartida)
ORDER BY RAND()
LIMIT 1;

RETURN IDNuevaCrt;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `GetNumCartesClrAcc` (`_IDColor` ENUM('red','green','blue','white','black'), `_IDPartida` INT UNSIGNED, `_IDJugador` TINYINT UNSIGNED, `_Turno` INT UNSIGNED) RETURNS TINYINT(3) UNSIGNED  BEGIN
    DECLARE cartastotalcolor TINYINT UNSIGNED default 0;

    SELECT count(*) INTO cartastotalcolor 
        from cartasparticipant as cp
        inner join cartas as c on cp.IDCartas = c.IDCartas
    WHERE cp.IDPartida = _IDPartida AND cp.IDJugador =_IDJugador
    AND cp.Turno= _Turno AND c.IDColor =_IDColor
    AND Reservada=false;

    RETURN ifnull(cartastotalcolor,0);

END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `GetNumGemasClrAcc` (`_IDColor` ENUM('red','green','blue','white','black','golden'), `_IDPartida` INT UNSIGNED, `_IDJugador` TINYINT UNSIGNED, `_Turno` INT UNSIGNED) RETURNS TINYINT(3) UNSIGNED  BEGIN
    DECLARE gemastotalcolor TINYINT UNSIGNED default 0;

    SELECT total INTO gemastotalcolor
        from gempos 
    WHERE IDPartida = _IDPartida AND IDJugador =_IDJugador 
    AND Turno= _Turno AND IDColor = _IDColor;

    RETURN ifnull(gemastotalcolor,0);

END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `getnumjugprt` (`_IDPartida` INT UNSIGNED) RETURNS TINYINT(3) UNSIGNED  BEGIN
    DECLARE num TINYINT UNSIGNED;

    SELECT count(*) INTO num
    FROM Participantes
    WHERE IDPartida = _IDPartida;
    
    RETURN num ;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `GetPowerClrAcc` (`_IDColor` ENUM('red','green','blue','white','black','golden'), `_IDPartida` INT UNSIGNED, `_IDJugador` TINYINT UNSIGNED, `_Turno` INT UNSIGNED) RETURNS TINYINT(3) UNSIGNED  BEGIN
    DECLARE gemastotalcolor   TINYINT UNSIGNED DEFAULT 0;
    DECLARE cartastotalcolor  TINYINT UNSIGNED DEFAULT 0;
    
    SELECT getnumcartesclracc (_IDColor, _IDPartida, _IDJugador, _Turno) INTO cartastotalcolor;
    SELECT GetNumGemasClrAcc (_IDColor, _IDPartida, _IDJugador, _Turno) INTO gemastotalcolor;

    RETURN gemastotalcolor + cartastotalcolor;

END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `GetTotalGemasAcc` (`_IDPartida` INT UNSIGNED, `_IDJugador` TINYINT UNSIGNED, `_Turno` INT UNSIGNED) RETURNS TINYINT(3) UNSIGNED  BEGIN
    DECLARE gemastotal TINYINT UNSIGNED default 0;

    SELECT sum(Total) INTO gemastotal
        from GemPos 
    WHERE IDPartida = _IDPartida AND IDJugador =_IDJugador;

    RETURN ifnull(gemastotal,0);

END$$

